import React, { Component } from 'react';
import AboutMe from './AboutMe';
import SkillsSection from './SkillsSection';
import MediumCarousel from './MediumCarousel';

class About extends Component {
  render() {
    return (
      <div>
        <AboutMe />
        <MediumCarousel />
        <SkillsSection />
      </div>
    );
  }
}

export default About;
